import UserData from '../../UserData/UserData';

import classes from './Cars.module.css';

const Cars = props => {
    return (
        <div>
            <div>
                <ul>
                    <li>BMW E46 320D</li>
                    <li>BMW E30 316i</li>
                </ul>
            </div>
        </div>
    )
}

export default Cars;
